import React from "react"
import { Droppable, Draggable } from 'react-beautiful-dnd'
import styles from './Schedule.module.css'

export default function Schedule({ containers, setContainers }) {
  return (
    <div className={styles.schedule}>
      {containers.map(container => (
        <Droppable key={container.id} droppableId={container.id}>
          {(provided) => (
            <div
              ref={provided.innerRef}
              {...provided.droppableProps}
              className={styles.container}
            >
              <h2>{container.id}</h2>
              {container.items.map((item, index) => (
                <Draggable key={item.courseNr} draggableId={item.courseNr} index={index}>
                  {(provided) => (
                    <div
                      ref={provided.innerRef}
                      {...provided.draggableProps}
                      {...provided.dragHandleProps}
                      className={styles.courseItem}
                    >
                      <div className={styles.dragableCourse}></div>
                      <div className={styles.courseContent}>{item.name}</div>
                    </div>
                  )}
                </Draggable>
              ))}
              {provided.placeholder}
            </div>
          )}
        </Droppable>
      ))}
    </div>
  )
}
